import React from "react";
import "../CSS/AccesDenied.css"
import {disconnect} from "../API/login/login";

class AccessDenied extends React.Component {

    disconnect(e) {
        e.preventDefault();
        window.location.reload();
    }

    render() {
        return <div id="divDenied">
            <p>Access Denied !</p>
            <p>You don't have permissions to reach there</p>
            <button id="buttonDisconnect" onClick={(e) => this.disconnect(e)}>Logout</button>
        </div>

    }
}

export default AccessDenied;
